ars\":\"Remaining characters: @chars\"},\"library\":\"H5P.TextInputField 1.2\",\"subContentId\":\"2ad719e3-2ed3-4140-96f0-33d953851025\",\"metadata\":{\"contentType\":\"Text input field editor element\",\"license\":\"U\",\"title\":\"Untitled Text input field editor element\"}}],\"helpTextLabel\":\"More information\",\"helpText\":\"\"},\"library\":\"H5P.StandardPage 1.5\",\"subContentId\":\"f9154ca2-8aa1-4483-9761-a3f4ef369030\",\"metadata\":{\"contentType\":\"Standard page\",\"license\":\"U\",\"title\":\"Mother hen\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Mother hen\"}},{\"params\":{\"elementList\":[{\"params\":{\"text\":\"<p>A <strong>\\\"mother hen\\\"</strong> is a person who cares for the needs of others in an over protective way.<br />\\nThis refers to the hen who handles all of the hatching details by sitting for 21 days on her fertilized eggs ensuring the <strong>right humidity and temperature (40C) </strong>for the healthy development of the embryo. When chicks hatch, the hen stays with them to <strong>keep them safe and warm</strong>, teaches them how to <strong>find food</strong> and <strong>calls them</strong> when they go far.</p>\\n\"},\"library\":\"H5P.Text 1.1\",\"subContentId\":\"e9f54149-9aad-4eee-ae31-4f776209c3aa\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}}],\"helpTextLabel\":\"More information\",\"helpText\":\"\"},\"library\":\"H5P.StandardPage 1.5\",\"subContentId\":\"8451b323-f052-4018-ae38-47027a2315a1\",\"metadata\":{\"contentType\":\"Standard page\",\"license\":\"U\",\"title\":\"Get the answers here\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Get the answers here\"}}],\"i10n\":{\"previousLabel\":\"Previous\",\"nextLabel\":\"Next\",\"closeLabel\":\"Close\"}},\"library\":\"H5P.DocumentationTool 1.8\",\"subContentId\":\"d490ce82-c9f8-4f6b-9dfb-f20c01692edd\",\"metadata\":{\"title\":\"Documentation tool\",\"license\":\"U\",\"contentType\":\"Documentation Tool\  dropzone.\",\"tipLabel\":\"Show tip.\",\"tipAvailable\":\"Tip available\",\"correctAnswer\":\"Correct answer\",\"wrongAnswer\":\"Wrong answer\",\"feedbackHeader\":\"Feedback\",\"scoreBarLabel\":\"You got :num out of :total points\",\"scoreExplanationButtonLabel\":\"Show score explanation\",\"localize\":{\"fullscreen\":\"Fullscreen\",\"exitFullscreen\":\"Exit fullscreen\"},\"a11yCheck\":\"Check the answers. The responses will be marked as correct, incorrect, or unanswered.\",\"a11yRetry\":\"Retry the task. Reset all responses and start the task over again.\",\"submit\":\"Submit\"},\"library\":\"H5P.DragQuestion 1.14\",\"subContentId\":\"d33eabbf-4981-48c8-a1e4-36251e087e3f\",\"metadata\":{\"contentType\":\"Drag and Drop\",\"license\":\"U\",\"title\":\"1- Different stages of the chick&#039;s development are listed in the following table in a disordered way. Number them in the right sequence.\",\"authors\":[],\"changes\":[],\"extraTitle\":\"1- Different stages of the chick&#039;s development are listed in the following table in a disordered way. Number them in the right sequence.\"}},\"useSeparator\":\"auto\"},{\"content\":{\"params\":{\"text\":\"<h3>2- Experimental protocol:</h3>\\n\\n<p>We take 5 chicken eggs. We put 4 of them in an incubator (an incubator will ensure the same conditions as if the hen is brooding the eggs).<br />\\nThe eggs are taken out from the incubator at regular intervals one at a time:<br />\\n1- the first egg was not put in an incubator so it is the egg of <strong>day 1</strong>.<br />\\n2- The 2nd is taken out at <strong>day 6</strong>.<br />\\n3- The 3rd at <strong>day 11</strong>.<br />\\n4- The 4th at <strong>day 17</strong>.<br />\\n5- The 5th at <strong>day 21</strong>.<br />\\nAn opening is made in the shell of each egg to observe the stages of development of the embryo.</p>\\n\"},\"library\":\"H5P.AdvancedText 1.1\",\"subContentId\":\"36b687e8-99b8-4fe7-a031-39c8e4b5faba\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"tit iv>Day 17</div>\\n\",\"tipsAndFeedback\":{\"tip\":\"\",\"feedbackOnCorrect\":\"\",\"feedbackOnIncorrect\":\"\"}},{\"x\":77.38461538461539,\"y\":13.953488372093023,\"width\":7.5,\"height\":5.625,\"correctElements\":[\"4\"],\"showLabel\":true,\"backgroundOpacity\":100,\"single\":true,\"autoAlign\":true,\"label\":\"<div>Day 21</div>\\n\",\"tipsAndFeedback\":{\"tip\":\"\",\"feedbackOnCorrect\":\"\",\"feedbackOnIncorrect\":\"\"}}]}},\"behaviour\":{\"enableRetry\":true,\"singlePoint\":false,\"applyPenalties\":false,\"enableScoreExplanation\":true,\"dropZoneHighlighting\":\"dragging\",\"autoAlignSpacing\":2,\"showTitle\":true,\"enableCheckButton\":true,\"enableFullScreen\":false,\"showScorePoints\":true},\"overallFeedback\":[{\"from\":0,\"to\":100,\"feedback\":\"You got @score of @total points\"}],\"grabbablePrefix\":\"Grabbable {num} of {total}.\",\"grabbableSuffix\":\"Placed in dropzone {num}.\",\"dropzonePrefix\":\"Dropzone {num} of {total}.\",\"noDropzone\":\"No dropzone.\",\"tipLabel\":\"Show tip.\",\"tipAvailable\":\"Tip available\",\"correctAnswer\":\"Correct answer\",\"wrongAnswer\":\"Wrong answer\",\"feedbackHeader\":\"Feedback\",\"scoreBarLabel\":\"You got :num out of :total points\",\"scoreExplanationButtonLabel\":\"Show score explanation\",\"localize\":{\"fullscreen\":\"Fullscreen\",\"exitFullscreen\":\"Exit fullscreen\"},\"a11yCheck\":\"Check the answers. The responses will be marked as correct, incorrect, or unanswered.\",\"a11yRetry\":\"Retry the task. Reset all responses and start the task over again.\",\"submit\":\"Submit\"},\"library\":\"H5P.DragQuestion 1.14\",\"subContentId\":\"979ad129-df85-4278-b26a-1d43fcad6e04\",\"metadata\":{\"contentType\":\"Drag and Drop\",\"license\":\"U\",\"title\":\"A picture of each egg was taken, but they were put in a disordered way. Put them in the right sequence.\",\"authors\":[],\"changes\":[],\"extraTitle\":\"A picture of each egg was taken, but they were put in a disordered way. Put them in the right sequence.\"}},\"useSeparator\":\"auto\"},{\"content\":{\"params\":{\"answers\":[{\"correct\":true,\"tipsAndFeedback\":{\"chosenFeedback\":\"<div>Right! And this is the purpose of the yolk. It is rich in protein and fat to nourish the developing embryo.</div>\\n\",\"tip\":\"\",\"notChosenFeedback\":\"\"},\"text\":\"<div>It has all been used by the embryo during its development.</div>\\n\"},{\"correct\":false,\"tipsAndFeedback\":{\"chosenFeedback\":\"<div>The temperature in the incubator is around 40C. If the yolk melted at this temperature, there would never be any chick.</div>\\n\",\"tip\":\"\",\"notChosenFeedback\":\"\"},\"text\":\"<div>It has melted in the incubator.</div>\\n\"},{\"correct\":false,\"tipsAndFeedback\":{\"chosenFeedback\":\"<div>The shell is semi permeable. It means that only air and moisture can pass through its pores.The yolk cannot pass through the shell without breaking it.</div>\\n\",\"tip\":\"\",\"notChosenFeedback\":\"\"},\"text\":\"<div>It has left the egg through the semi-permeable shell.</div>\\n\"}],\"UI\":{\"checkAnswerButton\":\"Check\",\"showSolutionButton\":\"Show solution\",\"tryAgainButton\":\"Retry\",\"tipsLabel\":\"Show tip\",\"scoreBarLabel\":\"Score\",\"tipAvailable\":\"Tip available\",\"feedbackAvailable\":\"Feedback available\",\"readFeedback\":\"Read feedback\",\"wrongAnswer\":\"Wrong answer\",\"correctAnswer\":\"Correct answer\",\"shouldCheck\":\"Should have been checked\",\"shouldNotCheck\":\"Should not have been checked\",\"noInput\":\"Please answer before viewing the solution\",\"a11yCheck\":\"Check the answers. The responses will be marked as correct, incorrect, or unanswered.\",\"a11yShowSolution\":\"Show the solution. The task will be marked with its correct solution.\",\"a11yRetry\":\"Retry the task. Reset all responses and start the task over again.\",\"submitAnswerButton\":\"Submit\"},\"behaviour\":{\"enableRetry\":true,\"enableSolutionsButton\":true,\"type\":\"auto\",\"singlePoint\":false,\"randomAnswers\":true,\"showSolutionsRequiresInput\":true,\"confirmCheckDialog\":false,\"confirmRetryDialog\":false,\"autoCheck\":false,\"passPercentage\":100,\"enableCheckButton\":true,\"showScorePoints\":true},\"confirmCheck\":{\"header\":\"Finish ?\",\"body\":\"Are you sure you wish to finish ?\",\"cancelLabel\":\"Cancel\",\"confirmLabel\":\"Finish\"},\"confirmRetry\":{\"header\":\"Retry ?\",\"body\":\"Are you sure you wish to retry ?\",\"cancelLabel\":\"Cancel\",\"confirmLabel\":\"Confirm\"},\"question\":\"<p>3- Notice the size of the yolk at day 6 and at day 11. Why did its volume decrease?</p>\\n\",\"overallFeedback\":[{\"from\":0,\"to\":100,\"feedback\":\"You got @score of @total points\"}],\"media\":{\"disableImageZooming\":false}},\"library\":\"H5P.MultiChoice 1.16\",\"subContentId\":\"7a4aeceb-0708-48a5-b575-2d7f7232e7a5\",\"metadata\":{\"contentType\":\"Multiple Choice\",\"license\":\"U\",\"title\":\"3- Notice the size of the yolk at day 6 and at day 11. Why did its volume decrease?\",\"authors\":[],\"changes\":[],\"extraTitle\":\"3- Notice the size of the yolk at day 6 and at day 11. Why did its volume decrease?\"}},\"useSeparator\":\"auto\"},{\"content\":{\"params\":{\"text\":\"<h3><strong>Activity 5 - Let us get acquainted with other oviparous animals</strong></h3>\\n\"},\"library\":\"H5P.AdvancedText 1.1\",\"subContentId\":\"3d8bb167-c7bc-4379-b349-7c0f9f589682\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"useSeparator\":\"auto\"},{\"content\":{\"params\":{\"presentation\":{\"slides\":[{\"elements\":[{\"x\":1.1488086280123198,\"y\":0,\"width\":98.84349435418,\"height\":8.816180925733036,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p><span style=\\\"font-size:1.125em\\\"><strong>How do snails reproduce?</strong></span></p>\\n\"},\"subContentId\":\"03e50627-5576-48b9-9b0f-19728a6d16f0\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"invisible\":false,\"solution\":\"\",\"buttonSize\":\"big\",\"goToSlideType\":\"specified\"},{\"x\":56.291622772603674,\"y\":15.885010676996462,\"width\":42.322109855973856,\"height\":78.41907835168053,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p>You have seen in an earlier activity that snails are <span style=\\\"color:#A52A2A\\\">hermaphrodites</span>.</p>\\n\\n<p>This means that each individual snail is capable of laying eggs.</p>\\n\\n<p>Although they are hermaphrodite, they still prefer to <span style=\\\"color:#A52A2A\\\">mate</span> in order to reproduce.</p>\\n\\n<p>In <span style=\\\"color:#A52A2A\\\">May</span> and in <span style=\\\"color:#A52A2A\\\">September,</span> they come together to mate.</p>\\n\\n<p><span style=\\\"color:#A52A2A\\\">3</span> to <span style=\\\"color:#A52A2A\\\">6</span> days after the snail is fertilized, it lays its eggs.</p>\\n\\n<p>Snails lay between <span style=\\\"color:#A52A2A\\\">30</span> and <span style=\\\"color:#A52A2A\\\">120</span> eggs at one time.</p>\\n\\n<p><span><span>Eggs hatch after approximately<span style=\\\"color:#c0392b\\\"> two weeks to 1 month</span> and snails emerge with a soft shell.</span></span></p>\\n\"},\"subContentId\":\"9bc00af7-6da8-4fa3-becb-865fac99f6a4\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"invisible\":false,\"solution\":\"\",\"buttonSize\":\"big\",\"goToSlideType\":\"specified\"},{\"x\":1.0339277652110879,\"y\":10.438721302026247,\"width\":25.273789816271037,\"height\":40.869863184672326,\"action\":{\"library\":\"H5P.Image 1.1\",\"params\":{\"contentName\":\"Image\",\"file\":{\"path\":\"data:image/jpeg;base64,/9j/4R2YRXhpZgAASUkqAAgAAAAQAAABAwABAAAApAkAAAEBAwABAAAAcwYAAAIBAwADAAAAzgAAAAYBAwABAAAAAgAAAA8BAgARAAA
